        private static int[] Way01FindLeaders(int[] array, int arrayLength)
        {
            List<int> leaderList = new List<int>();
            int maxValue = array[arrayLength - 1];
            leaderList.Add(maxValue); // Add last digit

            for (int i = arrayLength - 2; i >= 0; i--)
            {
                if (array[i] >= maxValue)
                {
                    maxValue = array[i];
                    leaderList.Add(maxValue);
                }
            }

            leaderList.Reverse();
            return leaderList.ToArray();
        }
